import React, { useState, useEffect } from "react";
import ReactFlow, {
  addEdge,
  useNodesState,
  useEdgesState,
  MiniMap,
  Controls,
  Background,
} from "reactflow";
import "reactflow/dist/style.css";
import { useParams } from "react-router-dom"; // –î–ª—è –ø–æ–ª—É—á–µ–Ω–∏—è –ø–∞—Ä–∞–º–µ—Ç—Ä–∞ –∏–∑ URL
import "./EditContainer.css"; // –ü–æ–¥–∫–ª—é—á–∞–µ–º —Å—Ç–∏–ª–∏

const COMPONENT_TYPES = {
  heater: { label: "üî• Heater", color: "#FF5733" },
  fan: { label: "üå¨Ô∏è Fan", color: "#33A1FF" },
  solar: { label: "‚òÄÔ∏è Solar battery", color: "#FFD700" },
};

const EditContainer = () => {
  const { containerId } = useParams(); // –ü–æ–ª—É—á–∞–µ–º ID –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä–∞ –∏–∑ URL
  const [nodes, setNodes] = useNodesState([]);
  const [edges, setEdges] = useEdgesState([]);
  const [selectedNode, setSelectedNode] = useState(null);
  const [nodeProperties, setNodeProperties] = useState({ power: "", efficiency: "" });

  useEffect(() => {
    // –ò–Ω–∏—Ü–∏–∞–ª–∏–∑–∞—Ü–∏—è –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä–∞ –∫–∞–∫ –ø–æ—Å—Ç–æ—è–Ω–Ω–æ–π –Ω–æ–¥—ã
    const containerNode = {
      id: `container-${containerId}`,
      position: { x: 100, y: 100 },
      data: { label: `Container #${containerId}`, type: "container" },
      style: {
        background: "#808080", // –¶–≤–µ—Ç —Ñ–æ–Ω–∞ –¥–ª—è –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä–∞
        border: "2px solid black",
        padding: 10,
        borderRadius: 5,
        color: "#fff",
        fontWeight: "bold",
      },
    };
    setNodes([containerNode]); // –°—Ç–∞–≤–∏–º –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä –≤ —Å—Ç–µ–π—Ç
  }, [containerId]);

  // –î–æ–±–∞–≤–ª–µ–Ω–∏–µ –Ω–æ–≤–æ–≥–æ –∫–æ–º–ø–æ–Ω–µ–Ω—Ç–∞
  const addNode = (type) => {
    const newNode = {
      id: `${type}-${Date.now()}`, // –ì–µ–Ω–µ—Ä–∞—Ü–∏—è —É–Ω–∏–∫–∞–ª—å–Ω–æ–≥–æ ID –¥–ª—è –∫–æ–º–ø–æ–Ω–µ–Ω—Ç–∞
      position: { x: Math.random() * 400, y: Math.random() * 400 },
      data: { label: COMPONENT_TYPES[type].label, type, power: "", efficiency: "" },
      style: {
        background: COMPONENT_TYPES[type].color,
        border: "2px solid black",
        padding: 10,
        borderRadius: 5,
        color: "#fff",
        fontWeight: "bold",
      },
    };
    setNodes((nds) => [...nds, newNode]);
  };

  // –û—Ç–∫—Ä—ã—Ç–∏–µ –º–µ–Ω—é —Ä–µ–¥–∞–∫—Ç–∏—Ä–æ–≤–∞–Ω–∏—è —Ö–∞—Ä–∞–∫—Ç–µ—Ä–∏—Å—Ç–∏–∫ —É–∑–ª–∞
  const onNodeClick = (event, node) => {
    setSelectedNode(node);
    setNodeProperties({ power: node.data.power || "", efficiency: node.data.efficiency || "" });
  };

  // –û–±–Ω–æ–≤–ª–µ–Ω–∏–µ —Ö–∞—Ä–∞–∫—Ç–µ—Ä–∏—Å—Ç–∏–∫ —É–∑–ª–∞
  const updateNodeProperties = () => {
    setNodes((nds) =>
      nds.map((node) =>
        node.id === selectedNode.id
          ? { ...node, data: { ...node.data, ...nodeProperties } }
          : node
      )
    );
    setSelectedNode(null);
  };

  const onConnect = (params) => setEdges((eds) => addEdge(params, eds));

  return (
    <div className="edit-container">
      <div className="control-panel">
        <button onClick={() => addNode("heater")}>Add heater üî•</button>
        <button onClick={() => addNode("fan")}>Add fan üå¨Ô∏è</button>
        <button onClick={() => addNode("solar")}>Add solar battery ‚òÄÔ∏è</button>
      </div>

      {/* React Flow Canvas */}
      <ReactFlow
        nodes={nodes}
        edges={edges}
        onConnect={onConnect}
        onNodeClick={onNodeClick}
        fitView
      >
        <MiniMap />
        <Controls />
        <Background />
      </ReactFlow>

      {/* –û–∫–Ω–æ —Ä–µ–¥–∞–∫—Ç–∏—Ä–æ–≤–∞–Ω–∏—è —Ö–∞—Ä–∞–∫—Ç–µ—Ä–∏—Å—Ç–∏–∫ */}
      {selectedNode && (
        <div className="edit-menu">
          <h3>Editing: {selectedNode.data.label}</h3>
          <p><strong>ID:</strong> {selectedNode.id}</p>
          <label>
            Power (W):
            <input
              type="number"
              value={nodeProperties.power}
              onChange={(e) =>
                setNodeProperties({ ...nodeProperties, power: e.target.value })
              }
            />
          </label>
          <label>
            Effectiveness (%):
            <input
              type="number"
              value={nodeProperties.efficiency}
              onChange={(e) =>
                setNodeProperties({ ...nodeProperties, efficiency: e.target.value })
              }
            />
          </label>
          <button onClick={updateNodeProperties}>Save changes</button>
        </div>
      )}
    </div>
  );
};

export default EditContainer;
